import React, { Component } from "react";
import "./style.css";

class BlockPreview extends Component {
  render() {
      return (
          <div className="card">
            <div className="preview-text">It never occured to Ethan that staying up all night would lead to his demise. He was so sick to his stomach the next day.</div>
            <div className="container">
            <h5>Word Coung</h5>
            <h5>No. of Contributors</h5>
            </div>
          </div>
      )
  }
}

export default BlockPreview;
